/*Table structure for table `i_article` */

DROP TABLE IF EXISTS `i_article`;

CREATE TABLE `i_article` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '发帖id',
  `uid` varchar(32) NOT NULL COMMENT '用户id',
  `title` varchar(100) NOT NULL COMMENT '标题',
  `color` varchar(20) NOT NULL COMMENT '标题颜色',
  `cover` varchar(255) NOT NULL COMMENT '封面',
  `content` text NOT NULL COMMENT '内容',
  `posttime` datetime NOT NULL COMMENT '发表时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COMMENT='文章信息表';

/*Data for the table `i_article` */

insert  into `i_article`(`id`,`uid`,`title`,`color`,`cover`,`content`,`posttime`) values (1,'18','测试','#2b2b32','/upload/20170502/7ff39476-f154-4511-abd1-4248c6a546d7.jpg','<p>测试测试</p><p><img src=\"/upload/20170502/c7821f6d-9164-4dfd-88ff-cee1299144f6.jpg\"/></p><p><img src=\"/upload/20170502/f1a4efb2-b1ba-4ecf-a9df-9450952d36ab.jpg\"/></p><p><br/></p>','2018-04-25 15:28:56'),(2,'18','测试','#2b2b32','/upload/20170502/15a2e757-0c6e-430e-8b8b-c949238ed17b.jpg','<pre>岗位职责：\r\n1．负责公司整体ios产品的整体架构设计，完成IOS平台手机软件的需求、设计、编码和自测工作；\r\n2．根据软件设计规范，开发基于iphone/ipad平台的应用程序；\r\n3．协同后台开发人员实现产品界面和功能与后台的交互；\r\n4．配合产品经理、UI设计师，研究并改善用户体验；\r\n\r\n任职要求：\r\n1、熟悉Object-C中MVC，封装，多态，委托代理，单例，Block，观察者等设计模式；\r\n2、熟悉iOS的内存管理机制和多线程开发，熟练运用GCD、NSOperation、NSThread等；\r\n3、具有良好的代码编程管理习惯，有独立分析问题和解决问题的能力；\r\n4、精通iOS下的并行开发、网络、内存管理、GUI开发等技术；\r\n5、精通iOS的消息传递机制，delegate，block，通知，推送等等；\r\n6、掌握iOS网络通信机制；熟悉http、tcp、socket等网络编程；\r\n7、了解iOS开发环境，对iOS与第三方平台开发接口的配合，有广泛深入的了解；\r\n8、具备良好的项目进度把控能力，能够独立承担项目任务，分析解决问题；\r\n9、对移动产品的用户体验有一定经验者优先。</pre><p><img src=\"/upload/20170502/631e6117-e726-4f33-8056-d54b792615ee.jpg\" title=\"\" alt=\"\"/></p>','2018-04-25 15:28:56'),(3,'0','ssds','#2b2b32','/upload/20180425/f75570c3-0a17-4824-a0d3-db9bd3fd2bf3.jpg','<p>sdsdfsdw</p>','2018-04-25 15:28:56'),(4,'0','dsdsss','#2b2b32','','<p>aasas</p>','2018-04-28 15:44:44');

/*Table structure for table `i_file` */

DROP TABLE IF EXISTS `i_file`;

CREATE TABLE `i_file` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `filename` varchar(255) NOT NULL COMMENT '文件原名',
  `nowname` varchar(255) NOT NULL COMMENT '文件名称',
  `savepath` varchar(255) NOT NULL COMMENT '存放位置',
