/*Table structure for table `xt_dept` */

DROP TABLE IF EXISTS `xt_dept`;

CREATE TABLE `xt_dept` (
  `deptid` varchar(32) NOT NULL,
  `title` varchar(50) NOT NULL COMMENT '部门名称',
  `level` varchar(25) NOT NULL,
  `content` varchar(200) DEFAULT NULL COMMENT '部门介绍',
  PRIMARY KEY (`deptid`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='部门表 分层级';

/*Data for the table `xt_dept` */

/*Table structure for table `xt_elect_contract` */

DROP TABLE IF EXISTS `xt_elect_contract`;

CREATE TABLE `xt_elect_contract` (
  `elect_contractid` varchar(32) NOT NULL COMMENT '电子合同ID',
  `userid` varchar(32) NOT NULL COMMENT '客户ID',
  `customer_name` varchar(30) NOT NULL COMMENT '客户名称',
  `name` varchar(100) DEFAULT NULL COMMENT '合同名称',
  `types` char(1) NOT NULL DEFAULT '0' COMMENT '合同类型',
  `address` varchar(100) DEFAULT NULL COMMENT '合同址地',
  `createdate` datetime NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`elect_contractid`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='电子合同表';

/*Data for the table `xt_elect_contract` */

/*Table structure for table `xt_feedback` */

DROP TABLE IF EXISTS `xt_feedback`;

CREATE TABLE `xt_feedback` (
  `feedbackid` varchar(32) NOT NULL,
  `customerid` varchar(10) DEFAULT NULL,
  `userid` varchar(32) DEFAULT NULL COMMENT '用户ID',
  `content` text COMMENT '题问内容',
  `createdate` datetime DEFAULT NULL,
  PRIMARY KEY (`feedbackid`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='反馈表';

/*Data for the table `xt_feedback` */

/*Table structure for table `xt_financelog` */

DROP TABLE IF EXISTS `xt_financelog`;

CREATE TABLE `xt_financelog` (
  `financelogid` varchar(32) NOT NULL COMMENT '财务日志id',
  `userid` varchar(32) NOT NULL COMMENT '消费用户ID',
  `opuserid` varchar(32) NOT NULL COMMENT '操作员ID',
  `customerid` varchar(10) NOT NULL COMMENT '商户号',
  `compid` varchar(32) NOT NULL COMMENT '企业id编码',
  `uname` varchar(255) DEFAULT NULL COMMENT '操作用户名',
  `status` char(1) NOT NULL COMMENT '状态(0正在处理,1处理成功,2处理失败)',
  `tradetype` char(1) NOT NULL COMMENT '综合征信，4四大借贷数据，5芝麻分等，8短信充值，9查询充值',
  `trademoney` double NOT NULL COMMENT '交易金额',
  `paymode` char(1) DEFAULT NULL COMMENT '支付方说明，如：0 支付宝、1 微信支付、2、银联转账',
  `bankinfo` varchar(64) DEFAULT NULL COMMENT '提现时用',
  `out_trade_no` varchar(40) NOT NULL COMMENT '流水单号',
  `transactionid` varchar(40) DEFAULT NULL,
  `createdate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '创建时间',
  PRIMARY KEY (`financelogid`,`opuserid`,`compid`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='费扣明细表';

