/*Table structure for table `xt_loanrecord` */

DROP TABLE IF EXISTS `xt_loanrecord`;

CREATE TABLE `xt_loanrecord` (
  `loanrecordid` varchar(32) NOT NULL COMMENT '借款记录ID',
  `opuserid` varchar(32) DEFAULT NULL COMMENT '操作用户ID',
  `userid` varchar(32) NOT NULL COMMENT '借款用户ID',
  `customerid` varchar(10) NOT NULL COMMENT '商户号',
  `productid` varchar(32) DEFAULT NULL COMMENT '产品ID',
  `customerorderno` varchar(32) NOT NULL COMMENT '客户订单号',
  `customername` varchar(20) DEFAULT NULL COMMENT '客户名',
  `mobile` varchar(15) DEFAULT NULL COMMENT '手机号',
  `status` char(1) DEFAULT '0' COMMENT '审核情况 0:待审核,1:审核中;2:已通过;3:拒绝受理;4已还清，5逾期了',
  `ifdelay` char(1) DEFAULT '0' COMMENT '是否可以申请延期  0不能申请，1可以申请，2申请延期，3延期通过，4延期拒绝',
  `amount` double(10,2) NOT NULL DEFAULT '0.00' COMMENT '借款款金额',
  `repayamount` double(10,2) DEFAULT '0.00' COMMENT '还款金额',
  `months` int(5) DEFAULT '7' COMMENT '贷款天数或者月数',
  `amountmust` double(10,2) DEFAULT '0.00' COMMENT '应收金额 到客户手上多少',
  `amountmonth` double(10,2) DEFAULT '0.00' COMMENT '月还款金额',
  `begindate` date NOT NULL COMMENT '开始借款日期',
  `enddate` date DEFAULT NULL COMMENT '结束日期时间',
  `createdate` datetime NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`loanrecordid`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='借款记录列表';

