/*Table structure for table `xt_loans_credit` */

DROP TABLE IF EXISTS `xt_loans_credit`;

CREATE TABLE `xt_loans_credit` (
  `loansid` int(11) NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `userid` varchar(32) NOT NULL COMMENT '用户ID',
  `types` char(1) DEFAULT '0' COMMENT '类型 0为已经用户ID的查询结果，1为直接用户姓名和身份证查询',
  `opuserid` varchar(32) DEFAULT NULL COMMENT '操作管理员ID',
  `customerid` varchar(10) DEFAULT NULL COMMENT '商户号',
  `code` varchar(10) DEFAULT NULL COMMENT '查询结果码',
  `id_no` varchar(25) DEFAULT NULL COMMENT '身份证号',
  `id_name` varchar(20) DEFAULT NULL COMMENT '姓名',
  `id_phone` varchar(25) DEFAULT NULL,
  `apply_score` varchar(10) DEFAULT NULL COMMENT '申请准入分',
  `apply_credibility` varchar(10) DEFAULT NULL COMMENT '申请准入置信度',
  `query_org_count` varchar(10) DEFAULT NULL COMMENT '查询机构数',
  `query_finance_count` varchar(10) DEFAULT NULL COMMENT '查询消费金融类机构数',
  `query_cash_count` varchar(10) DEFAULT NULL COMMENT '查询网络贷款类机构数',
  `query_sum_count` varchar(10) DEFAULT NULL COMMENT '总查询次数',
  `latest_query_time` varchar(20) DEFAULT NULL COMMENT '最近查询时间',
  `latest_one_month` varchar(10) DEFAULT NULL COMMENT '近1个月总查询笔数',
  `latest_three_month` varchar(10) DEFAULT NULL COMMENT '近3个月总查询笔数',
  `latest_six_month` varchar(10) DEFAULT NULL COMMENT '近6个月总查询笔数/',
  `loans_score` varchar(10) DEFAULT NULL COMMENT '贷款行为分',
  `loans_credibility` varchar(10) DEFAULT NULL COMMENT '贷款行为置信度',
  `loans_count` varchar(10) DEFAULT NULL COMMENT '贷款放款总订单数',
  `loans_settle_count` varchar(10) DEFAULT NULL COMMENT '贷款已结清订单数',
  `loans_overdue_count` varchar(10) DEFAULT NULL COMMENT '贷款逾期订单数（M0+）',
  `loans_org_count` varchar(10) DEFAULT NULL COMMENT '贷款机构数',
  `consfin_org_count` varchar(10) DEFAULT NULL COMMENT '消费金融类机构数',
  `loans_cash_count` varchar(10) DEFAULT NULL COMMENT '网络贷款类机构数',
  `latest_one_month_behavior` varchar(10) DEFAULT NULL COMMENT '近1个月贷款笔数',
  `latest_three_month_behavior` varchar(10) DEFAULT NULL COMMENT '近3个月贷款笔数',
  `latest_six_month_behavior` varchar(10) DEFAULT NULL COMMENT '近6个月贷款笔数',
  `history_suc_fee` varchar(10) DEFAULT NULL COMMENT '历史贷款机构成功扣款笔数',
  `history_fail_fee` varchar(10) DEFAULT NULL COMMENT '历史贷款机构失败扣款笔数',
  `latest_one_month_suc` varchar(10) DEFAULT NULL COMMENT '近1个月贷款机构成功扣款笔数',
  `latest_one_month_fail` varchar(10) DEFAULT NULL COMMENT '近1个月贷款机构失败扣款笔数',
  `loans_long_time` varchar(10) DEFAULT NULL COMMENT '信用贷款时长',
  `loans_latest_time` varchar(20) DEFAULT NULL COMMENT '最近一次贷款时间/',
  `loans_credit_limit` varchar(10) DEFAULT NULL COMMENT '网贷建议授信额度',
  `loans_credibility_current` varchar(10) DEFAULT NULL COMMENT '网贷额度置信度',
  `loans_org_count_current` varchar(10) DEFAULT NULL COMMENT '网络贷款类机构数',
  `loans_product_count` varchar(10) DEFAULT NULL COMMENT '网络贷款类产品数',
  `loans_max_limit` varchar(10) DEFAULT NULL COMMENT '网络贷款机构最大授信额度',
  `loans_avg_limit` varchar(10) DEFAULT NULL COMMENT '网络贷款机构平均授信额度	',
  `consfin_credit_limit` varchar(10) DEFAULT NULL COMMENT '消金建议授信额度',
  `consfin_credibility` varchar(10) DEFAULT NULL COMMENT '消金额度置信度',
  `consfin_org_count_current` varchar(10) DEFAULT NULL COMMENT '消费金融类机构数',
  `consfin_product_count` varchar(10) DEFAULT NULL COMMENT '消费金融类产品数',
  `consfin_max_limit` varchar(10) DEFAULT NULL COMMENT '消费金融类机构最大授信额度',
  `consfin_avg_limit` varchar(10) DEFAULT NULL COMMENT '消费金融类机构平均授信额度',
  `createdate` datetime DEFAULT NULL COMMENT '查询时间',
  PRIMARY KEY (`loansid`,`userid`)
) ENGINE=MyISAM AUTO_INCREMENT=97 DEFAULT CHARSET=utf8;

