  `monthcount` int(10) DEFAULT NULL COMMENT '一月总数',
  `threemonthcount` int(10) DEFAULT NULL COMMENT '三月总数',
  `name` varchar(30) DEFAULT NULL COMMENT '动作类型',
  PRIMARY KEY (`details_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='手机详细消费记录统计';

