/*Table structure for table `xt_news` */

DROP TABLE IF EXISTS `xt_news`;

CREATE TABLE `xt_news` (
  `newsid` varchar(32) NOT NULL,
  `compid` varchar(32) DEFAULT NULL COMMENT '企业id编码',
  `customerid` varchar(10) DEFAULT NULL COMMENT '商户号',
  `newstypeid` varchar(32) DEFAULT NULL,
  `watchtype` char(1) NOT NULL DEFAULT '0' COMMENT '0 公开观看，1教练观看 2学员家长观看',
  `title` varchar(256) NOT NULL COMMENT '新闻标题',
  `source` varchar(100) DEFAULT NULL COMMENT '源来',
  `author` varchar(50) DEFAULT NULL COMMENT '者作',
  `summary` varchar(500) DEFAULT NULL COMMENT '简要',
  `homepic` varchar(100) DEFAULT NULL COMMENT '封页图',
  `iffirstnews` char(1) DEFAULT '0' COMMENT '0为非首页，1为首页',
  `browsepoint` int(11) DEFAULT '0' COMMENT '浏览量',
  `content` longtext NOT NULL COMMENT '内容',
  `createdate` datetime NOT NULL COMMENT '发布时间',
  `position` char(1) DEFAULT '0' COMMENT '位置 1 为首页，2为乐官方 3乐俱乐部 4其他页面',
  `areaid` int(10) DEFAULT '58' COMMENT '地区id 城市id',
  `videopath` varchar(60) DEFAULT NULL COMMENT '视频路径 最多1个',
  `imgpath` varchar(550) DEFAULT NULL COMMENT '上传图片  最多9张 路径 空格隔开',
  `pathurl` varchar(150) DEFAULT NULL,
  PRIMARY KEY (`newsid`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='新闻表';

