  PRIMARY KEY (`newstypeid`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

/*Data for the table `xt_newstype` */

/*Table structure for table `xt_oper_user` */

DROP TABLE IF EXISTS `xt_oper_user`;

CREATE TABLE `xt_oper_user` (
  `opuserid` varchar(32) NOT NULL,
  `compid` varchar(32) NOT NULL COMMENT '企业id编码',
  `customerid` varchar(10) NOT NULL COMMENT '商户号',
  `username` char(20) NOT NULL COMMENT '录登名',
  `opname` varchar(20) DEFAULT NULL COMMENT '姓名',
  `password` char(32) NOT NULL,
  `email` varchar(100) DEFAULT NULL,
  `mobile` varchar(20) DEFAULT NULL COMMENT '手机号码',
  `weixin` varchar(50) DEFAULT NULL COMMENT '微信号码',
  `qrcode` varchar(200) DEFAULT NULL COMMENT '二维码',
  `belongto` varchar(50) DEFAULT NULL COMMENT '手机归属地',
  `useable` tinyint(4) NOT NULL DEFAULT '1' COMMENT '是否可用(0禁用,1可用)',
  `roleid` varchar(32) NOT NULL COMMENT '所属角色',
  `addtime` datetime NOT NULL COMMENT '创建时间',
  `logintime` datetime DEFAULT NULL COMMENT '登陆时间',
  `loginip` varchar(15) DEFAULT NULL COMMENT '登陆IP',
  `ifoper` char(1) DEFAULT '1' COMMENT '是否平台管理员 0不是平台管理员 1是平台管理员',
  PRIMARY KEY (`opuserid`),
  KEY `username` (`username`) USING BTREE,
  KEY `fk_user_role` (`roleid`),
  CONSTRAINT `fk_user_role` FOREIGN KEY (`roleid`) REFERENCES `auth_role` (`roleid`) ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

