/*Table structure for table `xt_order` */

DROP TABLE IF EXISTS `xt_order`;

CREATE TABLE `xt_order` (
  `orderid` varchar(32) NOT NULL COMMENT '订单ID',
  `productid` varchar(32) NOT NULL COMMENT '订购的产品ID',
  `userid` varchar(32) NOT NULL COMMENT '客户ID',
  `amount` double(10,2) NOT NULL DEFAULT '0.00' COMMENT '贷款金额',
  `amount_first` double(10,2) DEFAULT '0.00' COMMENT '首付',
  `months` int(5) DEFAULT '1' COMMENT '分期数',
  `amount_month` double(10,2) DEFAULT '0.00' COMMENT '月还款金额',
  `status` char(1) DEFAULT NULL COMMENT '状态 0申请中，1通过，2已回款，3逾期M0 \\4.M1 \\5.M2	\\6.M3\\7.M4',
  `createdate` datetime NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`orderid`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='订单表';

/*Data for the table `xt_order` */

/*Table structure for table `xt_paylog` */

DROP TABLE IF EXISTS `xt_paylog`;

CREATE TABLE `xt_paylog` (
  `paylogid` varchar(32) NOT NULL COMMENT '代付日志表ID',
  `opuserid` varchar(32) DEFAULT NULL COMMENT '操作用户ID',
  `userid` varchar(32) DEFAULT NULL COMMENT '客户ID',
  `customer_order_no` varchar(64) DEFAULT NULL COMMENT '客户订单号',
  `customer_name` varchar(20) DEFAULT NULL COMMENT '客户名',
  `bank_card_num` varchar(26) DEFAULT NULL COMMENT '银行卡号',
  `amount` double(10,2) DEFAULT '0.00' COMMENT '扣款金额',
  `mobile` varchar(15) DEFAULT NULL COMMENT '手机号',
  `merchant_order_no` varchar(60) DEFAULT NULL COMMENT '商户订单号',
  `ext_order_no` varchar(60) DEFAULT NULL COMMENT '外部订单号',
  `status` char(1) NOT NULL DEFAULT '0' COMMENT '状态',
  `pay_order_no` varchar(60) DEFAULT NULL COMMENT '支付订单号',
  `repay_status` char(1) DEFAULT '0' COMMENT '还款状态 0未还，1已还',
  `repay_date` datetime DEFAULT NULL COMMENT '还款时间',
  `cancel_status` char(1) DEFAULT '0' COMMENT '解约状态0未解约，1已解约',
  `createdate` datetime DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`paylogid`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='代付日志表';

/*Data for the table `xt_paylog` */

/*Table structure for table `xt_pic` */

DROP TABLE IF EXISTS `xt_pic`;

CREATE TABLE `xt_pic` (
  `picid` varchar(32) NOT NULL,
  `userid` varchar(32) NOT NULL COMMENT '用户ID',
