  `words` varchar(60) DEFAULT NULL COMMENT '需要朗读文字',
  `createdate` datetime DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`picid`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

