/*Table structure for table `xt_product` */

DROP TABLE IF EXISTS `xt_product`;

CREATE TABLE `xt_product` (
  `productid` varchar(32) NOT NULL COMMENT '贷款商品ID',
  `title` varchar(100) NOT NULL COMMENT '产品名称',
  `opuserid` varchar(32) DEFAULT NULL COMMENT '操作员',
  `customerid` varchar(10) DEFAULT NULL COMMENT '商户号',
  `status` char(1) DEFAULT NULL COMMENT '状态',
  `price` double(10,2) DEFAULT '0.00' COMMENT '价格',
  `amountfirst` double(10,2) DEFAULT '0.00' COMMENT '首付',
  `moneyrate` double(3,2) DEFAULT '0.25' COMMENT '息利',
  `months` int(5) DEFAULT '1' COMMENT '分期数',
  `amountmonth` double(10,2) DEFAULT '0.00' COMMENT '月还款金额',
  `content` text COMMENT '合同内容',
  `createdate` datetime NOT NULL COMMENT '创建时间',
  PRIMARY KEY (`productid`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

