  `sex` char(1) DEFAULT '1' COMMENT '性别',
  `mobile` varchar(20) NOT NULL COMMENT '手机号码',
  `belongto` varchar(50) DEFAULT NULL COMMENT '手机属于',
  `tel` varchar(64) DEFAULT NULL COMMENT '电话',
  `qq` varchar(20) DEFAULT NULL COMMENT 'qq/uc',
  `weixin` varchar(50) DEFAULT NULL COMMENT '微信',
  `email` varchar(100) DEFAULT NULL COMMENT '电子邮箱',
  `gpsaddress` varchar(200) DEFAULT NULL COMMENT 'GPS地址',
  `address` varchar(100) DEFAULT NULL COMMENT '现居住地',
  `post` varchar(100) DEFAULT NULL COMMENT '编邮',
