/* Function  structure for function  `GET_SN` */

/*!50003 DROP FUNCTION IF EXISTS `GET_SN` */;
DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` FUNCTION `GET_SN`(in_flag INT(10)) RETURNS int(11)
BEGIN 
		DECLARE result INT;
		DECLARE lORDERNO INT;  
		DECLARE lUSERLOGIN INT; 
		SET result = 0;
		IF(in_flag=1) THEN
			UPDATE XT_SN SET USERLOGIN=USERLOGIN+1;
			SELECT MAX(USERLOGIN) INTO lUSERLOGIN FROM XT_SN;
		ELSE IF(in_flag=2) THEN
			UPDATE XT_SN SET ORDERNO=ORDERNO+1;
			SELECT MAX(ORDERNO) INTO lUSERLOGIN FROM XT_SN;
		ELSE IF(in_flag=3) THEN
			UPDATE XT_SN SET CUSTOMERID=CUSTOMERID+1;
			SELECT MAX(CUSTOMERID) INTO lUSERLOGIN FROM XT_SN;
		END IF;
		END IF;
		END IF;
		SET result=lUSERLOGIN;
		RETURN(result); 
END */$$
DELIMITER ;

/* Procedure structure for procedure `addOrUpdateOper` */

/*!50003 DROP PROCEDURE IF EXISTS  `addOrUpdateOper` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `addOrUpdateOper`(IN `opcode` varchar(20),IN `ophref` varchar(50),IN `opname` varchar(50),IN `opseq` int,IN `ifoper` char(1))
BEGIN
	declare opid int default 0;
	select op.opid intoopid from auth_operation AS op where op.opcode = opcode and op.ophref = ophref;
	if opid > 0 then
		update auth_operation set opname = opname, opseq = opseq,ifoper=ifoper
		where opcode = opcode and ophref = ophref;
		delete from auth_operation where opid = opid;
	else
		insert into auth_operation(opcode, opname, ophref, opseq,ifoper)
		values(opcode, opname, ophref, opseq,ifoper);
	end if;
END */$$
DELIMITER ;

/* Procedure structure for procedure `bind_opers` */

/*!50003 DROP PROCEDURE IF EXISTS  `bind_opers` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `bind_opers`(IN `roleid` varchar(32))
BEGIN
	/*用于判断是否结束循环*/
	declare done int default 0;
	declare opid int;
	declare count int default 0;
	/*定义游标*/
	declare c_opid cursor for select op.opid from auth_operation op;
	/*定义 设置循环结束标识done值怎么改变 的逻辑*/
	declare continue handler for not FOUND set done = 1;
	/*打开游标*/
	open c_opid;
		repeat
			fetch c_opid into opid;
			if not done then
				select count(op.opid) into count from auth_role_operation op where op.roleid = roleid and op.opid = opid;
				if count <= 0 then
					insert into auth_role_operation(roleid, opid) values(roleid, opid);
				end if;
			end if;
		until done end repeat;
	close c_opid;  /*关闭游标*/
END */$$
DELIMITER ;

