/*!50003 CREATE DEFINER=`root`@`%` PROCEDURE `sp_auth_role_operation`()
BEGIN
	DECLARE   lroleid varchar(32)  DEFAULT '';
	Declare   flag int default 0;
	Declare cur1 cursor for select roleid from auth_role where roleid!=23 ;
	Declare continue handler for sqlstate '02000' set flag = 1;
	Open cur1;
