/* Procedure structure for procedure `Sp_CreateRandom` */

/*!50003 DROP PROCEDURE IF EXISTS  `Sp_CreateRandom` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `Sp_CreateRandom`(IN mobile varchar(11),IN num int,OUT result INT)
BEGIN
	DECLARE result INT DEFAULT 0;
	if num=4 then
		select FLOOR(1000+RAND()*9000) into result;
		INSERT INTO XT_CODE(CODEID,CODENO,UMOBILE,USTATUS,UCREATEDATE)VALUES(REPLACE(UUID(),'-',''),result,mobile,0,now());
	else
		select  FLOOR(100000+RAND()*900000) into result;
		INSERT INTO XT_CODE(CODEID,CODENO,UMOBILE,USTATUS,UCREATEDATE)VALUES(REPLACE(UUID(),'-',''),result,mobile,0,now());
	end if;
	delete from XT_CODE where TIMESTAMPDIFF(MINUTE,UCREATEDATE,now())>30;/*大于30分钟删除*/
	select result;
END */$$
DELIMITER ;

