	DECLARE  	lVar		int DEFAULT -1;
	DECLARE   vVar   VARCHAR(10) DEFAULT '';
	DECLARE   lstart int  DEFAULT -1;
	DECLARE   vstart VARCHAR(10) DEFAULT '';
	DECLARE   lend int  DEFAULT -1;
	DECLARE   vend VARCHAR(10) DEFAULT '';
	set lVar=0;
	drop temporary table if exists date_temp;
	create temporary table date_temp
		(
		 useid int(11) not null auto_increment,
		 recorddate varchar(10),
		 primary key (useid)
		)engine = memory;
		IF state=0 THEN
			set lstart=date_format(startDate, '%Y');
			set lend=date_format(endDate, '%Y');
			set lVar=lstart;
			While lVar<=lend do
				insert into date_temp(recorddate) values (lVar);
				set lVar=lVar+1;
			END while;
				if customerid is null or customerid='' then /*全局搜索*/
					select a.recorddate as createdate,IFNULL(sum(b.amount),0) as amount,'name' as customername,count(*) as count from date_temp a left join xt_loanrecord b  on year(b.createdate)= a.recorddate  group by a.recorddate order by a.recorddate asc;
