				on DATE_FORMAT(b.createdate,'%y')= DATE_FORMAT(STR_TO_DATE(CONCAT(a.recorddate,'-01-01'),'%Y-%m-%d'),'%y') where b.customerid in(select xt_compinfo.customerid from xt_compinfo where xt_compinfo.customerid=customerid) group by a.recorddate order by a.recorddate asc;
				end if;
