			set vstart=CONCAT(startDate);
			set vend=CONCAT(endDate);
			set lVar=1;
			set vVar=vstart;
			While DATE_FORMAT(STR_TO_DATE(vVar,'%Y-%m-%d'),'%y-%m-%d')<=DATE_FORMAT(STR_TO_DATE(vend,'%Y-%m-%d'),'%y-%m-%d') do
				insert into date_temp(recorddate) values (vVar);
				set vVar = adddate(vVar, interval 1 month);
				set lVar=lVar+1;
			END while;
				if customerid is null or customerid='' then /*全局搜索*/
					select CONCAT(year(a.recorddate),CONCAT('-',quarter(a.recorddate))) as createdate,IFNULL(sum(b.amount),0) as amount,'name' as customername,count(*) as count  from date_temp a left join xt_loanrecord b  on DATE_FORMAT(b.createdate,'%y-%m')= DATE_FORMAT(STR_TO_DATE(a.recorddate,'%Y-%m-%d'),'%y-%m')  group by CONCAT(year(a.recorddate),CONCAT('-',quarter(a.recorddate))) order by a.recorddate asc;
