				insert into date_temp(recorddate) values (vVar);
				set vVar = adddate(vVar, interval 1 month);
				set lVar=lVar+1;
			END while;
				if customerid is null or customerid='' then /*全局搜索*/
					select CONCAT(year(a.recorddate),CONCAT('-',month(a.recorddate))) as createdate,IFNULL(sum(b.amount),0) as amount,'name',count(*)  from date_temp a left join xt_loanrecord b  on DATE_FORMAT(b.createdate,'%Y-%m')= DATE_FORMAT(STR_TO_DATE(a.recorddate,'%Y-%m-%d'),'%Y-%m') group by CONCAT(year(a.recorddate),CONCAT('-',month(a.recorddate))) order by a.recorddate asc;
				else /*按照企业来统计*/
					select DATE_FORMAT(STR_TO_DATE(a.recorddate,'%Y-%m-%d'),'%Y-%m') as createdate,IFNULL(sum(b.amount),0) as amount,'' as customername,count(*) as count from date_temp a left join xt_loanrecord b
				on DATE_FORMAT(b.createdate,'%Y-%m')= DATE_FORMAT(STR_TO_DATE(a.recorddate,'%Y-%m-%d'),'%Y-%m') where b.customerid in(select xt_compinfo.customerid from xt_compinfo where xt_compinfo.customerid=customerid) group by DATE_FORMAT(STR_TO_DATE(a.recorddate,'%Y-%m-%d'),'%Y-%m') order by a.recorddate asc;
				end if;
		ELSE IF state=3 THEN
			set vstart=startDate;
			set vend=endDate;
			set lVar=1;
			set vVar=vstart;
			While DATE_FORMAT(STR_TO_DATE(vVar,'%Y-%m-%d'),'%Y-%m-%d')<=DATE_FORMAT(STR_TO_DATE(vend,'%Y-%m-%d'),'%Y-%m-%d') do
				insert into date_temp(recorddate) values (vVar);
