				if customerid is null or customerid='' then /*全局搜索*/
					select a.recorddate,sum(b.amount) as amount,'name',count(*)  from date_temp a left join xt_repayrecord b  on DATE_FORMAT(b.createdate,'%y-%m-%d')= DATE_FORMAT(STR_TO_DATE(a.recorddate,'%Y-%m-%d'),'%y-%m-%d') group by a.recorddate order by a.recorddate asc;
