/* Procedure structure for procedure `sp_getTempDate` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_getTempDate` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_getTempDate`(IN startDate varchar(10),IN endDate varchar(10),IN state   char(1))
BEGIN
	DECLARE  	lVar		int DEFAULT -1;
	DECLARE   vVar   VARCHAR(10) DEFAULT '';
	DECLARE   lstart int  DEFAULT -1;
	DECLARE   vstart VARCHAR(10) DEFAULT '';
	DECLARE   lend int  DEFAULT -1;
	DECLARE   vend VARCHAR(10) DEFAULT '';
	set lVar=0;
	drop temporary table if exists date_re_temp;
	create temporary table date_re_temp
		(
		 useid int(11) not null auto_increment,
		 recorddate varchar(10),
		 primary key (useid)
		)engine = memory;
		IF state='0' THEN
			set lstart=0+startDate;
			set lend=0+endDate;
			set lVar=lstart;
			While lVar<=lend do
				insert into date_re_temp(recorddate) values (lVar);
				set lVar=lVar+1;
			END while;
			select recorddate as createdate from date_re_temp c group by recorddate order by recorddate asc;
		ELSE IF state='1' THEN
			set vstart=CONCAT(startDate,'-01');
			set vend=CONCAT(endDate,'-01');
			set lVar=1;
			set vVar=vstart;
			While DATE_FORMAT(STR_TO_DATE(vVar,'%Y-%m-%d'),'%y-%m-%d')<=DATE_FORMAT(STR_TO_DATE(vend,'%Y-%m-%d'),'%y-%m-%d') do
				insert into date_re_temp(recorddate) values (vVar);
				set vVar = adddate(vVar, interval 1 month);
				set lVar=lVar+1;
			END while;
			select CONCAT(year(recorddate),CONCAT('-',quarter(STR_TO_DATE(recorddate,'%Y-%m-%d')))) as createdate from date_re_temp c group by CONCAT(year(recorddate),CONCAT('-',quarter(STR_TO_DATE(recorddate,'%Y-%m-%d')))) order by recorddate asc;
		ELSE IF state='2' THEN
			set vstart=CONCAT(startDate,'-01');
			set vend=CONCAT(endDate,'-01');
			set lVar=1;
			set vVar=vstart;
			While DATE_FORMAT(STR_TO_DATE(vVar,'%Y-%m-%d'),'%y-%m-%d')<=DATE_FORMAT(STR_TO_DATE(vend,'%Y-%m-%d'),'%y-%m-%d') do
				insert into date_re_temp(recorddate) values (vVar);
				set vVar = adddate(vVar, interval 1 month);
				set lVar=lVar+1;
			END while;
			select DATE_FORMAT(STR_TO_DATE(recorddate,'%Y-%m-%d'),'%y-%m') as createdate from date_re_temp c group by DATE_FORMAT(STR_TO_DATE(recorddate,'%Y-%m-%d'),'%y-%m') order by recorddate asc;
		ELSE IF state='3' THEN
			set vstart=startDate;
			set vend=endDate;
			set lVar=1;
			set vVar=vstart;
			While DATE_FORMAT(STR_TO_DATE(vVar,'%Y-%m-%d'),'%y-%m-%d')<=DATE_FORMAT(STR_TO_DATE(vend,'%Y-%m-%d'),'%y-%m-%d') do
				insert into date_re_temp(recorddate) values (vVar);
				set vVar = adddate(vVar, interval 1 day);
				set lVar=lVar+1;
			END while;
			select CONCAT(year(recorddate),CONCAT('-',week(recorddate))) as createdate from date_re_temp c group by CONCAT(year(recorddate),CONCAT('-',week(recorddate))) order by week(recorddate) asc;
		ELSE IF state='4' THEN
			set vstart=startDate;
			set vend=endDate;
			set lVar=1;
			set vVar=vstart;
			While DATE_FORMAT(STR_TO_DATE(vVar,'%Y-%m-%d'),'%y-%m-%d')<=DATE_FORMAT(STR_TO_DATE(vend,'%Y-%m-%d'),'%y-%m-%d') do
				insert into date_re_temp(recorddate) values (vVar);
				set vVar = adddate(vVar, interval 1 day);
				set lVar=lVar+1;
			END while;
			select recorddate as createdate from date_re_temp c order by recorddate asc;
		END IF;
		END IF;
		END IF;
		END IF;
		END IF;
		drop temporary table if exists date_re_temp;
END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_mobile_call_detailtotal` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_mobile_call_detailtotal` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_mobile_call_detailtotal`()
BEGIN
	declare lmobileid varchar(32) default 0;
	Declare  flag int default 0;
	Declare cur1 cursor for select mobileid from xt_mobile_credit where status = 0;
	Declare continue handler for sqlstate '02000' set flag = 1;
	Open cur1;
	REPEAT
	Fetch cur1 into lmobileid;
	IF NOT flag THEN
		insert into xt_mobile_call_detailstotal(details_id,mobileid,time,peer_number,location,location_type,duration,dial_type,fee,idialed,icount,weekcount,monthcount,threemonthcount,name)(select max(mcd.details_id),max(mcd.mobileid),max(mcd.time) as time,mcd.peer_number,max(mcd.location) as location,max(mcd.location_type) as location_type,FORMAT(sum(mcd.duration)/60,2) as duration,max(mcd.dial_type) as dial_type,sum(mcd.fee)/100 as fee,(select count(*) from xt_mobile_call_details mcds where mcds.mobileid =lmobileid and mcds.dial_type='DIALED' and  mcds.peer_number=mcd.peer_number) as idialed,count(*) as icount,(SELECT count(*) from  xt_mobile_call_details  mcdd where mcdd.peer_number=mcd.peer_number and time>date_add((select max(time) from xt_mobile_call_details where mobileid =lmobileid )  , interval -1 week) ) as weekcount,(SELECT count(*) from  xt_mobile_call_details  mcdd where mcdd.peer_number=mcd.peer_number and time>date_add((select max(time) from xt_mobile_call_details where mobileid =lmobileid)  , interval -1 MONTH) ) as monthcount,(SELECT count(*) from  xt_mobile_call_details  mcdd where mcdd.peer_number=mcd.peer_number and time>date_add((select max(time) from xt_mobile_call_details where mobileid =lmobileid)  , interval -1 MONTH) ) as threemonthcount,max(m.name) as name from xt_mobile_call_details mcd left join xt_mobile m on mcd.peer_number=m.mobilephone  where mcd.mobileid =lmobileid group by mcd.peer_number order by icount desc);
		update xt_mobile_credit set status = 1 where mobileid = lmobileid;
	END IF;
   	 UNTIL flag END REPEAT;
	Close cur1;
END */$$
DELIMITER ;

